description:
Prime Suspect (1991) 



 Stars: Helen Mirren, John Benfield, Tom Bell 



A female police detective investigates a series of serial murders while dealing with sexist hostility from her male comrades.


 D.C.I. Tennison seizes the opportunity to head a murder investigation--something she should have done long ago, had she not been passed over by her male superiors time and again. With a suspect already identified and her own team openly hostile, she uncovers errors and conflicting facts that point to a cover-up within the force. Is this a single murder or the latest act of a serial killer? Tennison refuses to back off the investigation


